import React, { useEffect, useState } from "react";

function Home() {
  const [data, setData] = useState();

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch("localhost:27017/PakistanTechiesInEurope");
      const json = await response.json;
      if (response.ok) {
        setData(json);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h2>Home</h2>
      <div>{data && data.map((user) => <p key={data._id}>{data.name}</p>)}</div>
    </div>
  );
}

export default Home;
